import React, {Component} from 'react';

class AnswerPage extends Component {
  render() {return(
    <div
      className="answer-page"
      onKeyDown={this.props.onEnterPress.bind(this.props,this.props.onSubmit)}>

      <div className="answer-inner">
        {this.props.qBank[0].Hiragana}
        <br />
        {this.props.qBank[0].English}
      </div>
      <br />

      <button className="submitBtn" onClick={this.props.onNext}>Next</button>
    </div>);
  }
}

export default AnswerPage;
